INSERT INTO `annotation_type` (`id`,`title`,`display_title`,`description`,`value_type`,`version`,`version_date`,`group_name`,`is_transcript_specific`) VALUES
(3,'rsid','rs-num','The rs-number of a variant from dbSNP (version summary: https://www.ncbi.nlm.nih.gov/projects/SNP/snp_summary.cgi)','text','155','2021-06-16','ID',0),(4,'phylop_100way','PhyloP-100way','PhyloP 100 vertebrates (100-way) conservation scores. These scores measure evolutionary conservation at individual alignment sites. Interpretations of the scores are compared to the evolution that is expected under neutral drift. Positive scores: Measure conservation, which is slower evolution than expected, at sites that are predicted to be conserved. Negative scores: Measure acceleration, which is faster evolution than expected, at sites that are predicted to be fast-evolving. ','float','-','2013-12-01','Pathogenicity',0),(5,'cadd_scaled','CADD','The scaled CADD scores: PHRED-like (-10*log10(rank/total)) scaled C-score ranking a variant relative to all possible substitutions of the human genome (8.6x10^9). These scores range from 1 to 99. A cutoff for deleteriousness can be set to 10-15, but the choice remains arbitrary.','float','v1.6','2020-04-11','Pathogenicity',0),(6,'revel','REVEL','The REVEL pathogenicity score of this variant. This score can range from 0 to 1, which reflects the number of trees in the random forest that classified the variant as pathogenic. Thus, higher values represent a more \"certain\" decision. When choosing a cutoff one should keep in mind that higher cutoffs will result in a higher specificity, but lower sensitivity.','float','v1.3','2021-05-03','Pathogenicity',1),(7,'spliceai_details','spliceAI','Details about the SpliceAI predictions: These include delta scores (DS) and delta positions (DP) for acceptor gain (AG), acceptor loss (AL), donor gain (DG), and donor loss (DL). Format: GENE|DS_AG|DS_AL|DS_DG|DS_DL|DP_AG|DP_AL|DP_DG|DP_DL','text','v1.3.1','2021-09-07','Splicing',0),(8,'spliceai_max_delta','spliceAI max delta','Max of delta scores for acceptor gain, acceptor loss, donor gain and donor loss. A value of 0.5 or more can be assumed to have an impact on splicing.','float','v1.3.1','2021-09-07','Splicing',0),(9,'maxentscan_ref','MaxEntScan ref','MaxEntScan reference sequence score. The lower the score, the more difference one would expect the input (ie mutated) sequence is from the reference. Whenever the difference between ref and alt is positive it predicts a functional splice site. A negative difference predicts that this position is not a functional splice site.','float','-','2018-08-29','None',0),(10,'maxentscan_alt','MaxEntScan alt','MaxEntScan alternate sequence score calculated though VEP release-104.3 using the MaxEntScan plugin','float','-','2018-08-29','None',0),(11,'gnomad_ac','AC','gnomAD alternate allele count for samples','int','v3.1.2','2021-10-22','gnomAD',0),(12,'gnomad_af','AF','gnomAD frequency of alternate allele in samples','float','v3.1.2','2021-10-22','gnomAD',0),(13,'gnomad_hom','hom','gnomAD number of homozygous individuals in samples','int','v3.1.2','2021-10-22','gnomAD',0),(14,'gnomad_hemi','hemi','gnomAD number of hemizygous individuals in samples','int','v3.1.2','2021-10-22','gnomAD',0),(15,'gnomad_het','het','gnomAD number of heterozygous individuals in samples','int','v3.1.2','2021-10-22','gnomAD',0),(16,'gnomad_popmax','popmax','gnomAD population with maximum allele frequency (AF)','text','v3.1.2','2021-10-22','gnomAD',0),(17,'gnomadm_ac_hom','mito AC hom','Allele count restricted to variants with a heteroplasmy level >= 0.95 from the GnomAD mitochondrial genome data. These variants are (almost) homozygous among all mitochondria in an individual','int','v3.1','2020-11-17','gnomAD',0),(18,'brca_exchange_clinical_significance','BRCA exchange','Variant pathogenicity as displayed in the Summary view of the BRCA exchange database','text','54','2022-02-22','None',0),(19,'flossies_num_afr','num AFR','Number of individuals with this variant in the african american cohort. (n=2559)','int','-','2022-03-25','FLOSSIES',0),(20,'flossies_num_eur','num EUR','Number of individuals with this variant in the european american cohort. (n=7325)','int','-','2022-03-25','FLOSSIES',0),(21,'arup_classification','ARUP classification','Pathogenicity classification from the ARUP database (1: not pathogenic or of no clinical significance, 2: likely not pathogenic or of little clinical significance, 3: uncertain, 4: likely pathogenic, 5: definitely pathogenic)','int','-','2022-04-01','None',0),(22,'cancerhotspots_cancertypes','cancertypes','A | delimited list of all cancertypes associated to this variant according to cancerhotspots. FORMAT: tumortype:tissue','text','v2','2017-12-15','Cancerhotspots',0),(23,'cancerhotspots_ac','AC','Number of samples showing the variant from cancerhotspots','int','v2','2017-12-15','Cancerhotspots',0),(24,'cancerhotspots_af','AF','Allele Frequency of the variant (AC / num samples cancerhotspots)','float','v2','2017-12-15','Cancerhotspots',0),(25,'rsid','rs-num','https://www.ncbi.nlm.nih.gov/projects/SNP/snp_summary.cgi)','text','0','2010-07-01','ID',0),(26,'rsid','rs-num','atests','text','0','2010-01-01','ID',0),(27,'tp53db_class','class','Family classification: LFS = strict clinical definition of Li-Fraumeni syndrome, LFL = Li-Fraumeni like for the extended clinical definition of Li-Fraumeni, FH: family history of cancer which does not fulfil LFS or any of the LFL definitions, No FH: no family history of cancer, FH= Family history of cancer (not fulfilling the definition of LFS/LFL),  No= no family history of cancer, ?= unknown','text','r20','2019-07-01','TP53 database',0),(29,'tp53db_DNE_LOF_class','DNE LOF class','Functional classification for loss of growth-suppression and dominant-negative activities based on Z-scores','text','r20','2019-07-01','TP53 database',0),(30,'tp53db_bayes_del','bayes del','Missense variant functional predictions by BayesDel tool (Feng 2017) used without allele frequency. Score bigger or equal to 0.16: damaging, Score smaller than 0.16: tolerated','float','r20','2019-07-01','TP53 database',0),(31,'tp53db_DNE_class','DNE class','Dominant-negative effect on transactivation by wild-type p53. Yes: dominant-negative activity on WAF1 and RGC promoters, Moderate: dominant-negative activity on some but not all promoters, No: no dominant-negative activity on both WAF1 and RGC promoters, or none of the promoters in the large studies.','text','r20','2019-07-01','TP53 database',0),(32,'tp53db_domain_function','domain function','Function of the domain in which the mutated residue is located.','text','r20','2019-07-01','TP53 database',0),(33,'tp53db_transactivation_class','transactivation class','Functional classification based on the overall transcriptional activity','text','r20','2019-07-01','TP53 database',0),(36,'task_force_protein_domain','domain','The description of the protein domain from a hand-crafted table by the VUS-Task-Force.','text','-','2022-06-01','Protein Domain',0),(37,'task_force_protein_domain_source','source','The source of the task force protein domain.','text','-','2022-06-01','Protein Domain',0),(39,'hexplorer','hexplorer','The HEXplorer delta score (HZEI mutant - HZEI wildtype). HZEI scores were normalized by the total number of nucleotide positions which contribute to the score.','float','1.0','2022-06-30','Splicing',0),(40,'hexplorer_mut','hexplorer mut','The HEXplorer score for the mutant sequence. HZEI scores were normalized by the total number of nucleotide positions which contribute to the score.','float','1.0','2022-06-30','Splicing',0),(41,'hexplorer_wt','hexplorer wt','The HEXplorer score for the reference sequence. HZEI scores were normalized by the total number of nucleotide positions which contribute to the score.','float','1.0','2022-06-30','Splicing',0),(42,'hexplorer_rev','hexplorer reverse','The HEXplorer delta score for the reverse complement of the original sequence (HZEI mutant rev - HZEI wildtype rev). HZEI scores were normalized by the total number of nucleotide positions which contribute to the score.','float','1.0','2022-06-30','Splicing',0),(43,'hexplorer_rev_mut','hexplorer reverse mut','The HEXplorer score for the reverse complement of the mutant sequence. HZEI scores were normalized by the total number of nucleotide positions which contribute to the score.','float','1.0','2022-06-30','Splicing',0),(44,'hexplorer_rev_wt','hexplorer reverse wt','The HEXplorer score for the reverse complement of the reference sequence. HZEI scores were normalized by the total number of nucleotide positions which contribute to the score.','float','1.0','2022-06-30','Splicing',0),(45,'max_hbond','max HBond','The HBond delta score (max HBond mutant - max HBond wildtype). This score shows the change in binding affinity of the U1 snRNA to the splice site motiv, i. e. its ability to form hbonds with the sequence motiv. Negative values show that the mutant sequence is less probable to bind the U1 snRNA (This is a \"worse\" binding site). Positive values mean that the mutant sequence is more likely to bind the U1 snRNA. If there are multiple possible splice sites only the max values are considered.','float','1.0','2022-06-30','Splicing',0),(46,'max_hbond_mut','max HBond mut','The max HBond score for the mutant sequence. ','float','1.0','2022-06-30','Splicing',0),(47,'max_hbond_wt','max HBond wt','This is the max HBond score for the reference sequence.','float','1.0','2022-06-30','Splicing',0),(48,'max_hbond_rev','max HBond reverse','The max HBond delta score for the reverse complement of the original sequence (HZEI mutant rev - HZEI wildtype rev). This score shows the change in binding affinity of the U1 snRNA to the splice site motiv, i. e. its ability to form hbonds with the sequence motiv. Negative values show that the mutant sequence is less probable to bind the U1 snRNA (This is a \"worse\" binding site). Positive values mean that the mutant sequence is more likely to bind the U1 snRNA. If there are multiple possible splice sites only the max values are considered.','float','1.0','2022-06-30','Splicing',0),(49,'max_hbond_rev_mut','max HBond reverse mut','This is the max HBond score for the reverse complement of the mutant sequence.','float','1.0','2022-06-30','Splicing',0),(50,'max_hbond_rev_wt','max HBond reverse wt','This is the max HBond score for the reverse complement of the reference sequence.','float','1.0','2022-06-30','Splicing',0),(51,'gnomad_popmax_AF','popmax AF','The allele frequency of the \"popmax\" population','float','v3.1.2','2021-10-22','gnomAD',0),(52,'hci_prior','HCI prior','The prior probability of pathogenicity as reported in the priors HCI website. These range from 0.97 for variants with high probability to damage a donor or acceptor to 0.02 for exonic variants that do not impact a splice junction and are unlikely to create a de novo donor.','float','1','2022-11-15','Pathogenicity',0),(53,'maxentscan','MaxEntScan','The transcript specific MaxEntScan scores calculated from ngs-bits.','text','v1.0.0','2023-09-27','Splicing',1),(54,'maxentscan_swa','MaxEntScan SWA','The transcript specific MaxEntScan SWA scores calculated from ngs-bits. A special application of the MaxEntScan algorithm to discover de-novo spliceing variants.','text','v1.0.0','2023-09-27','Splicing',1),(55,'bayesdel','BayesDEL','Missense variant functional predictions by BayesDel tool (Feng 2017) used without allele frequency. Score bigger or equal to 0.16: damaging, Score smaller than 0.16: tolerated. Scores were imported from dbNSFP.','float','4.4','2023-05-06','Pathogenicity',0),(56,'heredicare_vid','HerediCare VID','The VID from HerediCare.The version_date is inaccurate. They are always up to date when reimporting from heredicare.','int','-','2023-01-01','ID',0),(57,'clinvar','ClinVar variation ID','The Variation ID from ClinVar','int','-','2023-02-26','ID',0),(58,'cosmic','COSMIC variation ID','The COSV ID from COSMIC','text','-','2023-06-06','ID',0),(59,'gnomad_popmax_AC','popmax AC','The allele count from the popmax population from GnomAD','int','v3.1.2','2021-10-22','gnomAD',0),(60,'cosmic','COSMIC variation ID','THIS IS A TEST - OLD VERSION','int','-','2023-10-10','ID',0);
